import { ApiProperty } from '@nestjs/swagger';

export class createDoctorBodyDto {
  @ApiProperty({
    description: 'Имя',
    example: 'Michail',
  })
  name: string;
  @ApiProperty({
    description: 'Фамилия',
    example: 'Michailov',
  })
  surname: string;
  @ApiProperty({
    description: 'Email',
    example: 'michail.228@gmail.com',
  })
  email: string;
  @ApiProperty({
    description: 'Пароль',
    example: 'qwerty123',
  })
  password: string;
  @ApiProperty({
    description: 'Дата рождения',
    example: 123456789865,
  })
  bornDate: number;
  @ApiProperty({
    description: 'Фото',
    example: 'data:image/jpeg;base64,',
  })
  img: string;
  @ApiProperty({
    description: 'Описание',
    example: 'описание',
  })
  description: string;
}